import React, { useState } from 'react';

function ProductRegistration() {
  const [productName, setProductName] = useState('');
  const [productPrice, setProductPrice] = useState('');
  const [productDescription, setProductDescription] = useState('');
  const [products, setProducts] = useState([]);

  const handleProductRegistration = (e) => {
    e.preventDefault();

    // 새로운 상품 객체를 생성하고 현재의 상품 목록에 추가
    const newProduct = {
      name: productName,
      price: productPrice,
      description: productDescription,
    };

    setProducts([...products, newProduct]);

    // 폼 초기화
    setProductName('');
    setProductPrice('');
    setProductDescription('');
  };

  return (
    <div>
      <h2>상품 등록</h2>
      <h2>상품 등록</h2>
      <h2>상품 등록</h2>
      <h2>상품 등록</h2>
      <h2>상품 등록</h2>
      <h2>상품 등록</h2>
      <h2>상품 등록</h2>
                                    <div class="col-md-6 col-lg-6 col-xl-4">
                                        <div class="rounded position-relative fruite-item">
                                            <div class="fruite-img">
                                                <img src="img/best1.jpg" class="img-fluid w-100 rounded-top" alt="" />
                                            </div>
                                            <div class="p-4 border border-secondary border-top-0 rounded-bottom">
                                                <h4>굽네치킨</h4>
                                                <p>불금치킨+모짜치즈볼+콜라1.25L</p>
                                                <div class="d-flex justify-content-between flex-lg-wrap">
                                                    <p class="text-dark fs-5 fw-bold mb-0">P 25,500</p>
                                                    <a href="#" class="btn border border-secondary rounded-pill px-3 text-primary"><i class="me-2 text-primary"></i>구매하기</a>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
      <form onSubmit={handleProductRegistration}>
        <div>
          <label>상품명:</label>
          <input
            type="text"
            value={productName}
            onChange={(e) => setProductName(e.target.value)}
          />
        </div>
        <div>
          <label>상품 가격:</label>
          <input
            type="text"
            value={productPrice}
            onChange={(e) => setProductPrice(e.target.value)}
          />
        </div>
        <div>
          <label>상품 설명:</label>
          <textarea
            value={productDescription}
            onChange={(e) => setProductDescription(e.target.value)}
          ></textarea>
        </div>
        <button type="submit">등록</button>
      </form>

      {/* 등록된 상품 목록 */}
      <h2>상품 목록</h2>
      <div>
        {products.map((product, index) => (
          <div key={index}>
            <h3>{product.name}</h3>
            <p>{product.description}</p>
            <p>{product.price}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ProductRegistration;
